import React from 'react';

const Termine = () => {
    return (
        <div>   
            <div className="container">
                <hr/>
                <span class="badge badge-pill badge-primary">Primary</span>
                <h5 className="event-subtitle">Al Albert</h5>
                <p>Allgemeine Untersuchung</p>
                <hr/>
            </div>  
        </div>
    );
};

export default Termine;
